import React from "react";
import './style.scss';
import { useHistory } from "react-router-dom"

export default function Header() {
  const history = useHistory();

function redirectUser() {
  history.push("/");
}

  return (
    <header className="home__header">
      <h1 className = "home__header__title">
       BellyBirds
      </h1>
      <a className="global-header__logo" id="global-header__logo" href="/"  onClick={redirectUser}>
        <img src="//static.phoenixcontact.com/common/assets/images/signal-chain.svg" alt="PhoenixContact"/>
     </a>
    </header>
  )
}
